To find (AxB) ∩ B, we first need to find the Cartesian product of sets A and B and then take the intersection with set B. Similarly, to find (BxA) ∩ B, we need to find the Cartesian product of sets B and A and then take the intersection with set B.

(AxB) = {(1,2), (1,3), (1,4), (2,2), (2,3), (2,4), (3,2), (3,3), (3,4)}
(AxB) ∩ B = {(2,2), (2,3), (3,3)}

(BxA) = {(2,1), (3,1), (4,1), (2,2), (3,2), (4,2), (2,3), (3,3), (4,3)}
(BxA) ∩ B = {(2,2), (3,3)}

Hence, (AxB) ∩ B = {(2,2), (2,3), (3,3)} and (BxA) ∩ B = {(2,2), (3,3)}.

Now, let's consider the statement 'The Cartesian product of two sets is not associative with respect to intersection.' This can be shown with an example:

Let A = {1} and B = {2}.

(AxB) ∩ B = { (1,2) } and (BxA) ∩ B = { (2,2) }.

So, (AxB) ∩ B = { (1,2) } is not equal to (BxA) ∩ B = { (2,2) }, proving that the Cartesian product of two sets is not associative with respect to intersection.

