Let's break this down. The cost of the unique superfruit juice cocktail is $1399.45 per litre. The mixed fruit juice costs $262.85 per litre and the açaí berry juice costs $3104.35 per litre. The manager has already used 37 litres of the mixed fruit juice. To find out how many litres of açaí berry juice the manager needs to add, we can set up an equation. Let x be the number of litres of açaí berry juice needed. The total cost of the cocktail will be $1399.45 = ($262.85 * 37) + ($3104.35 * x). Now, we can solve for x. Program can be - 

const costPerLitreMixedFruitJuice = 262.85;
const costPerLitreAcaiBerryJuice = 3104.35;
const totalCostCocktail = 1399.45;
const litresMixedFruitJuiceUsed = 37;
const neededLitresAcaiBerryJuice = (totalCostCocktail - (costPerLitreMixedFruitJuice * litresMixedFruitJuiceUsed)) / costPerLitreAcaiBerryJuice;
console.log('The manager needs to add ' + neededLitresAcaiBerryJuice + ' litres of açaí berry juice.');
